INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('3a19193b-7d4b-45d8-929f-37e79f4a5162', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Rawlings Ash Wood Baseball Bat, Black, 33-in', 'The Rawlings ash wood baseball bat features a large barrel design and 31/32" handle to help you hit the ball further. The flame treated ash wood construction contributes to this bat''s solid feel and power, while the medium length of 33" offers a balanced yet speedy swing. Whether you''re an up-and-coming Little Leaguer or seasoned recreational player, this classic bat will help you drive the ball to all fields.', 8999, '2023-12-17 03:24:36.600949+00', '2023-12-17 03:24:36.600949+00', 'Aisle 65');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('d718c607-702a-4694-a1db-79d339048f1a', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Big Red Heavy-Duty + Garage Floor Jack w/ Quick Start, 3.5-Ton', 'The Big Red Heavy-Duty Garage Floor Jack brings 3.5 tons of pure lifting power straight to your garage. Its wide-stance stability keeps things steady under heavy loads, while a two-piece handle makes transportation easy. With a lifting range from 5 to nearly 20 inches, this floor jack handles everything from oil changes to brake jobs easily, while also having a safety overload system.', 19999, '2023-12-17 03:30:53.889596+00', '2023-12-17 03:30:53.889596+00', 'Aisle 6');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('c459b230-7e1d-49fe-8d6e-eb176f414ebb', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Mastercraft 7-Function, 19 Range Digital Multimeter', 'Mastercraft Digital 7-Function Multimeter is a versatile multimeter with 19 unique ranges. This digital multimeter features precision and simplicity in a compact instrument and an easy-to-read display.', 3699, '2023-12-17 03:28:15.648591+00', '2023-12-17 04:31:55.531851+00', 'Aisle 34');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('9c593b11-b1c5-4df6-a725-2ecceeda4084', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Coleman Hampton 3-Season, 9-Person, 2-Room Camping Cabin Tent w/ Room Divider, Rain Fly & Carry Bag, 14-ft x 10-ft', 'The Coleman 9-Person Hampton Cabin Camping Tent is the ideal family tent with ample space for up to 3 queen-size air beds and an optional room divider for added privacy. Its hinged door swings open for easy access in and out. A center height of 6 feet 10 inches means you''ll have plenty of headroom for stretching out.', 29999, '2023-12-17 02:23:16.117002+00', '2023-12-17 02:23:16.117002+00', 'Aisle 72');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('93dbbc8c-4293-49de-b70b-ac10d6ed6b26', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Coleman Skydome 3-Season, 4-Person Easy Set-Up Camping Dome Tent w/ Rain Fly, Vestibule, E-Port & Carry Bag', 'Sets up in under 5 minutes so you spend less time pitching the tent and more time relaxing at the campsite. The Coleman Skydome Camping Tent with Full-Fly Vestibule offers extra weather protection and more storage space with the full-fly vestibule area. Go ahead and stretch out inside. The nearly vertical walls offer 20% more headroom than a traditional Coleman dome tent. Plus, a wide door design means you can move airbeds, sleeping bags, and other gear in and out with ease. Downpour in the forecast? This tent features the WeatherTec system, with welded corners and inverted seams that help keep you and your gear dry. ', 18999, '2023-12-17 02:54:09.058977+00', '2023-12-17 02:54:09.058977+00', 'Aisle 72');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('089f46dc-5e7a-4056-b828-91683af00240', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Outbound 3-Season, 3-Person Easy Set-Up Camping Dome Tent w/ Rain Fly & Carry Bag', 'For effortless three season camping, this Outbound Dome Tent is the tent for you. A free-standing, shock-corded fibreglass design makes it simple to set up. With a sleeping capacity of three people, you’ll be impressed by how spacious the tent is. Two internal mesh pockets will help you keep organized and offer plenty of extra storage for your gear, while the classic dome shape offers a peak height of 3.5 feet. The durable polyester canopy is built to last season after season. The inside zip window features a mesh covering for excellent flow-through ventilation while keeping bugs out.', 4999, '2023-12-17 02:57:31.429692+00', '2023-12-17 02:57:31.429692+00', 'Aisle 72');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('e4992db5-890e-4367-92e2-cc058dd5ed65', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Ameristep Brickhouse Ground Portable 3-Person Hunting Blind/Camo Tent, 59 x 59 x 67-in', 'The Silent Brickhouse blinds three hunters while keeping them completely concealed and noiseless. New for the 2018 season, the blind features a hinged door that allows entry and exit without a sound. Additionally, the silent mesh windows let you adjust your view of the surroundings while muting any noise. Nature may be listening but this blind ensures whatever you''re hunting won''t hear a peep, allowing you to stalk your prey with the utmost stealth.', 29999, '2023-12-17 02:58:45.761397+00', '2023-12-17 02:58:45.761397+00', 'Aisle 69');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('7ab5291d-ccc9-4e17-b885-2488cbe9ac0c', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'AmeristeP Doghouse Portable 2-Person Hunting Blind/Camo Tent, 60 x 60 x 68-in', 'Getting sent to the doghouse is no longer punishment; it''s the greatest reward. The Doghouse® spring steel blind travels easily and sets up quickly to conceal two hunters inside. The exterior features a large, open window perfect for firearm hunting, with the option to add provided shoot-through mesh covers to each porthole. The matte finish of the Durashell™ Plus fabric and 3D Edge ReLeaf® trim blend well with the natural environment, and an interior ShadowGuard™ coating helps eliminate shadows and silhouettes.', 15999, '2023-12-17 03:00:04.508057+00', '2023-12-17 03:00:04.508057+00', 'Aisle 69');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('3f89ba62-3b11-4089-b176-91f1b63a44ac', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'CCM Ribcor Prime Composite Hockey Stick, Youth, Purple/Black', 'The CCM Ribcor Prime Composite Hockey Stick is a youth-sized, purple and black hockey accessory. The design aligns with the CCM Ribcor range. The stick boasts a low kickpoint for swift release and a unique construction with an optimized flex ratio. The SXX2 blade is stiff at the heel and extra stiff at the toe, supporting quick releases. The traditional T-Geometry shaft is designed for a comfortable hand fit. The stick''s flex ratio enhances stickhandling and passing. It measures 48" in height and is available in left and right-handed variants. The colour scheme is purple/black/grey with a purple blade.', 5499, '2023-12-17 03:04:27.266054+00', '2023-12-17 03:04:27.266054+00', 'Aisle 56');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('9a2eeae4-45da-4f7e-ac26-e7d6677f2b0d', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Sherwood 19K Wood Hockey Stick, Youth, 43 Flex', 'The Sherwood 19K Wood Hockey Stick, Youth, 43 Flex, is an excellent choice for young players looking to take their game to the next level. This mid-toe hockey stick features a 43 flex and a PP26 curve so players can make powerful shots with confidence. Made from high-quality wood, this hockey stick offers unmatched durability and performance on the ice. This youth hockey stick is available in left-hand and right-hand orientation, so it accommodates all playing styles.', 3999, '2023-12-17 03:06:04.58871+00', '2023-12-17 03:06:04.58871+00', 'Aisle 56');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('441e6f70-a018-4847-acd8-6c648ef8fb69', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Rawlings Wicked Youth Baseball Bat, Red, 30-in', 'The Rawlings Wicked youth baseball bat packs power into a lightweight, durable design that''s perfect for young sluggers. Crafted from alloy steel, this bat features an endloaded design to maximize energy transfer at impact, helping hitters drive the ball further. The balanced swing weight and tight grain structure make it easy to control through the hitting zone for straight-flying line drives and towering home runs. An ultra thin handle contributes to the bat''s lightweight feel without sacrificing durability, so youth players can focus their energy on crushing fastballs rather than fighting a heavy bat.', 4999, '2023-12-17 03:17:24.257946+00', '2023-12-17 03:17:24.257946+00', 'Aisle 65');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('d177def7-24d1-4d7e-9a46-12d3cd6553ab', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Mastercraft 1/2-in Drive, Torque Wrench, 50-250 ft-lbs', 'The Mastercraft 1/2-in Drive, Torque Wrench features a 1/2 inch drive and 50-250 ft-lb torque range, and is built for tackling heavy-duty jobs. Its precision ball bearing release mechanism ensures accurate torque control within 4% for critical applications. The audible and sensory click also notify you when your preset torque is reached, preventing overtightening. With reversing switch capabilities and SAE/metric scales, this wrench can adapt to any job with ease.', 9999, '2023-12-17 03:37:27.015575+00', '2023-12-17 03:37:27.015575+00', 'Aisle 12');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('e176170f-4eba-4a61-95f2-50cc0ce27cd9', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'MotoMaster Metric Lug Wrench w/ Sockets', 'The MotoMaster Lug Wrench with Sockets is designed specifically for use with alloy wheels that feature deep-set lug nuts to allow for much faster removal. This lug wrench features an impressive chrome-vanadium steel construction with a rubber handle for a better grip, along with an expandable arm to provide extra torque when you need it. The included lug wrench sockets are designed to fasten 17 mm, 19 mm, 21 mm, and 22.2 mm lug nuts. The wrench is also highly compact, which allows for more convenient storage.', 3499, '2023-12-17 03:38:20.386012+00', '2023-12-17 03:38:20.386012+00', 'Aisle 2');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('ecb9b657-2b49-44ee-bb2b-394fdc33f498', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Certified Metric 3-Way Lug Wrench, 14-in', 'The Certified 14" Metric 3-Way Lug Wrench is an innovative multi-head wrench that makes it easier to loosen lug nuts on a wide variety of vehicle classes. This Certified metric lug wrench is easy transport from project to project and offers a versatile choice for an array of automotive and industrial work. The metric lug wrench is constructed from resistant chrome-vanadium and intended for use with 17 mm, 19mm, and 21 mm lug nuts. This lug wrench even features an impressive pry bar arm that offers added leverage to assist with damaged fastener removal.', 2299, '2023-12-17 03:39:15.076029+00', '2023-12-17 03:39:15.076029+00', 'Aisle 2');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('bbde1bc1-0115-4985-972c-33e7b4a37e56', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Mastercraft 5-in-1 Digital Multimeter, Measures AC/DC Voltage and Current, Blue', 'The versatile Mastercraft 5-in-1 Digital Multimeter can measure five types of electrical elements and has 14 functions that include testing resistance, capacitance, frequency, diode, continuity, duty cycle, sound level, relative, illumination, temperature and humidity. It can also measure AC/DC voltage and current. This digital multimeter has a large backlit LCD screen to comfortably read the display in dimly lit areas and a 3999-count resolution for accurate readings. It also has a hold button that can retain data after testing.', 8399, '2023-12-17 03:27:12.370552+00', '2023-12-17 04:28:02.369275+00', 'Aisle 34');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('64305f84-83b1-4532-b267-1f4780fd7410', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Husqvarna 460 Rancher 60.3cc 2-Cycle Engine Gas Chainsaw, Orange/Grey, 24-in', 'This chainsaw delivers top professional performance for homeowners. Featuring Husqvarna''s X-TORQ engine for impressive power, increased fuel efficiency and reduced emissions, it easily tackles tough cutting jobs around your property. The ergonomic design incorporates LowVib technology which reduces vibrations, making this saw comfortable to operate even during high-power use.', 77999, '2023-12-19 03:27:45.836081+00', '2023-12-19 03:27:45.836081+00', 'Aisle 112');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('63bc48de-0101-46da-83b9-5b5405af3857', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'MotoMaster Fall/Winter Chainsaw Bar Oil, 4-L', 'MotoMaster Fall/Winter Chainsaw Bar Oil, in a 4-L container, is designed to protect chainsaw bar and chain components during harsh weather conditions. The multi-grade formula provides superior cold temperature flow, ensuring constant lubrication and cooling. Anti-wear additives guard against friction and rust, while tackifier additives reduce oil sling loss, enabling smoother cuts and enhancing the lifespan of your bar and chain. The fluid''s distinct red tint indicates its presence on the bar and chain. This oil is unsuitable for 2-cycle engines, and should only be added to the chainsaw reservoir. Please refer to the owner''s manual and Safety', 2699, '2023-12-19 03:29:01.53041+00', '2023-12-19 03:29:01.53041+00', 'Oil Rack');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('ffa29d4b-92e9-4533-9c0f-3c9ab73e025b', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'TruFuel 50:1 Pre-Mixed Gas & Oil for 2-Cycle Engines, 946 ml', 'This pre-mixed fuel and oil solution is perfect for keeping your 2-cycle engines running smoothly. The synthetic oil eliminates plug fouling and smoke, providing advanced lubrication that extends the life of rubber and plastic components by removing ethanol from the mix. The stabilizers keep the fuel fresh every time you use it and dispersing water that can damage your leaf blowers, chainsaws or grass trimmers. The premixed formula takes the guesswork out of fuel ratios, saving time and hassle while ensuring optimum performance.', 1099, '2023-12-19 03:30:09.260057+00', '2023-12-19 03:30:09.260057+00', 'Aisle 112');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('a9b6d207-a13a-4790-80ca-6196ab9ddd7d', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'TruFuel 40:1 Pre-Mixed Fuel & Oil for 2-Cycle Engines, 3.25-L', 'TruFuel premixed fuel eliminates the hassle of mixing oil and gas for your 2-cycle tools. Simply pour it into the tank of chainsaws, leaf blowers, trimmers and go. The synthetic oil delivers advanced lubrication that prevents plug fouling and smoke, so your equipment runs smooth without interruptions. No more measuring cups or messy spills - just grab the bottle, pour, and let your tools do the work. The ready-to-use fuel is ethanol-free and provides high-octane performance whether you''re a professional or DIY homeowner tackling yard work.', 2999, '2023-12-19 03:30:59.748397+00', '2023-12-19 03:30:59.748397+00', 'Aisle 112');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('2f218312-9766-4c05-9666-1df8480e3f78', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'DEWALT DWMT70773 Heavy-Duty 1/2-in Pneumatic Air Impact Wrench', 'DEWALT 1/2-in drive impact wrench heavy duty-pneumatic. Maximum torque 650 ft-lb helps to break free fasteners that are stubborn or stuck. One hand operation-forward/reverse switch for quick and easy switching. Shock resistant housing bumpers helps protect housing and prevent scuffing.', 31999, '2023-12-19 03:32:47.334382+00', '2023-12-19 03:32:47.334382+00', 'Aisle 12');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('9f505a66-1e83-4abc-9cb1-62da0e85aa00', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'DEWALT DCF892B 20V MAX* XR® Cordless 1/2" Mid-Range Impact Wrench with Detent Pin Anvil (Tool Only)', 'When you need the perfect balance of high performance and size to get tough jobs done, use this new 20V MAX XR Cordless 1/2 in. Mid-Range Impact Wrench with Detent Pin Anvil. This power tool delivers 600 ft-lbs of max fastening torque and 800 ft-lbs. of max breakaway torque for challenging projects. Designed to help prevent overtightening in forward, and run-off in reverse, the wrench integrates a Precision Wrench setting to help optimize user control. Utilize the updated 4-mode push button switch to easily transition speeds when needed. This Impact Wrench is ideal for pipe flanges, grooved couplings, tilt wall braces, wheel lugs.', 31999, '2023-12-19 03:35:01.992288+00', '2023-12-19 03:35:01.992288+00', 'Aisle 14');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('ea245232-87a6-4bb1-9f0b-cf50403f8725', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Shakespeare Outcast Spinning Fishing Rod and Reel Combo, Pre-Spooled, Medium, Assorted Sizes, 2-pc', 'Shakespeare® combos are ideal for anglers looking for a reliable product without breaking the bank. The Outcast® spinning combo is perfect for a wide variety of species and anglers.', 3799, '2023-12-19 03:36:54.809571+00', '2023-12-19 03:36:54.809571+00', 'Aisle 68');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('67c0211b-c65e-420c-8d26-56f1dcab9172', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Ugly Stik GX2 Spinning Fishing Rods, Medium, 6.6-ft, 2-pc', 'Ugly Stik GX2™ is the next generation of Ugly Stik that combines the heritage and tradition of the original while maintaining the strength and durability Ugly Stiks are known for. Ugly Stik GX2™ rods offer better balance for lighter feel, improved components, and eye-catching cosmetics for a more modern look versus the prior generation.', 7499, '2023-12-19 03:41:20.937205+00', '2023-12-19 03:41:30.643605+00', 'Aisle 68');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('f4b06929-87a7-4dca-b37e-b1240757c045', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Master Chef Outdoor BBQ Grill Brush w/ Palmyra Bristle & Stainless Steel Scraper, 18-in', 'Featuring natural wood bristles that burn or char if they fall out, the MASTER Chef Palmyra Bristle Grill Brush with Scraper is a safer BBQ grill brush option that helps reduce the risk of stray bristles in your food. The steel scraper tip helps remove stubborn burnt-on food while the 18" length offers a longer reach for more effective cleaning. Plus, the softer bristles on this grill brush and scraper help maintain your barbecue''s cooking surface. Palmyra is a natural wooden fiber and is a safer alternative to metal bristles, and as a natural product it is more susceptible to breakage.', 649, '2023-12-19 03:42:37.205457+00', '2023-12-19 03:42:37.205457+00', 'Aisle 115');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('ab0689b5-0f3b-4796-a895-3513967a6065', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Vermont Castings Premium Outdoor BBQ Hardwood Grill Brush, Smart Certified™ w/ Palmyra Bristle', 'With a large brush head and wide surface area, the Vermont Castings Premium Grill Brush is perfect for getting your dirty grill grates spotless. Featuring natural bristles made of palmyra, a sustainable material that rarely needs replanting and promotes healthy ecosystems, this BBQ brush has a SmartCertified™ bristle design that is a safer alternative for scrubbing than traditional metal bristle designs. Its grip makes it easy to apply more pressure for tough-to-remove residue on your grill.', 2699, '2023-12-19 03:43:33.706491+00', '2023-12-19 03:43:33.706491+00', 'Aisle 115');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('fa1b656e-8904-4c9f-b3c0-4419a6041d99', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'MASTER Chef 280 2-Burner Propane Gas BBQ Grill', 'Start the weekend off right with a grill session on the MASTER Chef 280 Propane Barbecue. Packing a lot of heat in a convenient size, this 2-burner propane BBQ is built with a stainless steel dual valve burner and generous 280 sq. in. cooking surface that holds up to 11 burgers, allowing you to grill up a feast for friends and family. The compact size means this gas barbecue grill can fit neatly onto almost any deck or patio, allowing you to enjoy home grilled burgers, hot dogs, steaks, sausages, chicken breasts, kabobs and more no matter the size of your backyard. ', 13999, '2023-12-19 03:45:01.202328+00', '2023-12-19 03:45:01.202328+00', 'Floor');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('63b0ef84-8923-4c43-a88a-dfc909054c53', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'MASTER Chef Grill Turismo 4-Burner Convertible BBQ with Side Burner', 'Highly functional and versatile, the MASTER Chef 4-Burner Grill Turismo™ Propane BBQ with Convertible Valve System is truly in a league of its own. Made for grill masters, this powerful gas barbecue grill features a generous 650 sq. in. main cooking area with four stainless steel burners at 40,000 BTUs, plus an extra side burner with 10,000 BTUs, to take care of all your outdoor grilling and cooking needs. Use the main cooking grate on this 4-burner propane BBQ to sear hamburgers, hot dogs, steak, chicken, kabobs and more while also whipping up vegetables, sauces and other side dishes on the handy barbecue side burner. ', 49999, '2023-12-19 03:45:37.535336+00', '2023-12-19 03:45:37.535336+00', 'Floor');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('62540750-9f82-4c54-8eba-30fb3ddc3d5c', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Coleman Roadtrip Portable 3-Burner Propane Gas BBQ Grill with a Folding Cart Stand', 'Coleman Roadtrip Portable Stand-up Propane Grill features 285 sq. in. of total cooking surface
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('7fcc2958-f6c4-4428-8e12-a73bb8672c5a', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Yardworks Dry Seal Heavy-Duty PVC Garden Hose with Crush-Resistant Coupling, 5/8-inx80-ft', 'The Yardworks Dry Seal Heavy-Duty PVC Garden Hose with Crush-Resistant Coupling, 5/8-in x 80-ft, features durable construction for a passionate DIYer. Featuring a leak-proof performance, it is ideal for lawn and garden use. This hose pipe is part of the Yardworks Dry Seal System that is engineered with a precision connection and a revolutionary washer to guarantee a no-leak system. Thanks to the double-braided radial reinforcement, the water hose is extremely durable and resilient. The no-torsion system enables the hose to straighten itself without any bends while the crush-resistant brass couplings give extra life for long-term use.', 7499, '2023-12-19 03:48:21.346146+00', '2023-12-19 03:48:21.346146+00', 'Aisle 115');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('0ab74578-1d02-4062-906b-ecfe82d60b86', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Troy-Bilt FWD 150cc Briggs & Stratton Vertical Storage Lawn Mower', 'The perfect chainsaw for smaller cutting jobs around the house or cottage, this lightweight gas saw packs plenty of power in a compact package. With its 42cc engine, the 16 inch bar and chain cuts quickly and easily through branches up to 4 inches thick. The automatic chain oiler ensures the bar and chain stay lubricated for smoother cutting, while the anti-vibration handles and overall lightweight design make using this saw comfortable for longer periods. With features like the inertia activated chain brake and SpringAssistTM technology for easier pull starts, this saw prioritizes safety and ease of use.', 67999, '2023-12-19 03:50:50.12662+00', '2023-12-19 03:50:50.12662+00', 'Floor');
INSERT INTO public.products (id, organization_id, name, description, price, created_at, updated_at, location) VALUES ('b494752a-8570-4cb0-b411-e0d0540109e5', 'e341c9bc-29ca-473c-90ee-d4c49c8897e6', 'Greenworks 80V Cordless String Grass Trimmer, Tool Only', 'This Greenworks Pro 80V Cordless 16" String Trimmer features an attachment capable power head for versatile use, compatible with most gas attachments. The Greenworks lineup features over 20 high-performance Pro 80V tools, allowing you to ditch your gas tools for an innovative, eco-friendly alternative.', 24999, '2023-12-19 03:49:53.16225+00', '2023-12-19 03:53:06.995221+00', 'Floor');
